import MyCard from "../UI/MyCard";
import assets_data from "../data/assets.json";
import { useSelector } from "react-redux";


const CardData = ()=>{
    viziblePage = useSelector(state=>state.myPage.pagelist[1])
    console.log(vis)
    const listCharacter = assets_data.assets.map((item)=>
        <MyCard 
            id = {item.id}
            name = {item.name}
            image = {item.image}
            owner = {item.owner}
        />)

    return <div>{listCharacter}</div>

}

export default CardData;
